import { useEffect } from 'react';
import Card from '../components/Card'
import Box from '@mui/material/Box';

const OutputWindow = ({graph}) => {
    useEffect(async () => {
        return (
            <Box sx={{p: 8}}>
                <Card graph={graph}/>
            </Box>
        )
    }, [graph])

}

export default OutputWindow
